import React from "react";
import {
  Grid,
  makeStyles,
  CardHeader,
  Card,
  CardContent,
  Typography,
  Divider,
  Chip,
} from "@material-ui/core";
import BTE from "./product-bte.png";
import CIC from "./product-cic.png";
import IIC from "./product-iic.png";
import ITC from "./product-itc.png";
import RIC from "./product-ric.png";
import ITE from "./product-ite.png";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  chip: {
    color: "white",
  },
  mb3: {
    marginBottom: "10px",
  },
}));

const getHeaderColor = (type) => {
  switch (type) {
    case "BTE":
      return theme.palette.primary.dark;
    case "CIC":
      return theme.palette.warning.dark;
    case "IIC":
      return theme.palette.success.dark;
    case "ITC":
      return theme.palette.success.dark;
    case "RIC":
      return theme.palette.success.dark;
    case "ITE":
      return theme.palette.success.dark;
    default:
      return BTE;
  }
};

const ListeningAidCard = (props) => {
  const classes = useStyles();
  const { information } = props;
  const list = information.map((information) => (
    <Grid container>
      <Grid item xs={12} md={12} key={information._id}>
        <Typography variant="h3" color="inherit" align="center">
          {information.name}
        </Typography>
        <Divider />
      </Grid>
      <Grid container className={classes.root} spacing={2}>
        <Grid item xs={12} sm={6}>
          <Typography variant="h5" color="inherit" align="left" paragraph>
            {information.description}
          </Typography>
        </Grid>
        <Grid item xs={12} sm={6}>
          <img src={information.type} />
        </Grid>
      </Grid>
    </Grid>
  ));

  return (
    <Grid item xs={12} md={12}>
      {list}
    </Grid>
  );
};
export default ListeningAidCard;
